import React, { Component } from "react";
import './Home.css';
import homepage from "../image/Home.jpg";

export default class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="Page">
            <img className="HomePage" src={homepage}/>
            <p>Welcome to the future of widgets</p>
        </div>
      </div>
    );
  }
}
